INSERT INTO `series` VALUES (15611,'Monster Child',NULL,'괴물아기  ',NULL,'','','ليس فقط أن شارلوت أصبحت أقوى ، ولكن تشارلي يتغير أيضًا .... كل منهم يفتقد شيء لذا الآخر .... لكن هل سيكون بمقدورهم مساعدة بعضهم البعض؟',1,0,'2019-09-08 21:23:25',1,0,'2019-09-08 23:23:25','أكشن,دراما,رومانسي,غموض,نفسي,قوى خارقة,ويب-تون',NULL,'',NULL,NULL,'كورية مانهوا','مستمرة',NULL,NULL,0,0),(15612,'Tensei shitara Slime Datta Ken','حينما بعثت من جديد بجسد سلايم','転生したらスライムだった件 That Time I Got Reincarnated as a Slime ',2014,'Fuse','Kawakami Taiki','مينامي ساتورو رجل أعزب يموت بعد أن قام لص بطعنه و بينما هو ملقى على . الأرض يسمع صوتا غريبا يبدو كصوت حاسب آلي فيقوم بإعطائه مهارة فريدة ثم . يستيقظ فيجد نفسه في عالم آخر لكن ليس عالمه هو الشيء الوحيد الذي تغير بل . حتى جسده بل في الواقع لم يعد له جسد فلقد تحول ليصبح مجرد طين، فكيف . سيتطيع التعايش مع هذا العالم الجديد و هذا الجسد الجديد ؟؟',1,0,'2019-09-08 21:23:49',0,0,'2019-09-08 23:23:49','أكشن,خيال,دراما,شونين,كوميدي,مغامرات,زمنكاني',NULL,'mal::http://myanimelist.net/manga/87610/Tensei_shitara_Slime_Datta_Ken,manga_fox::http://mangafox.me/manga/tensei_shitara_slime_datta_ken/,manga updates::https://www.mangaupdates.com/series.html?id=119910',NULL,NULL,'يابانية مانجا','مستمرة',NULL,NULL,0,0),(15613,'I Was Trash','لقد كنت قمامة',' I Was Trash 我本废柴',2018,'Yoon\'s Color','sansa','كان ينظر إلى أسفل ، واضطر إلى قطع خطوبته ، وقتل ، وربما هذه هي الحياة التي ينبغي أن يعيشها القمامة ... ولكن تم الاستيلاء عليه من قبل أقوى مزارع ، كانغ كون تشى ، . الآن أنا هنا ، سأقوم بأفضل ما في الأمر! شاهدني وأنا استخدام هذا الجسم القمامة حتى أخطو عليك مثل النمل! ',1,0,'2019-09-08 21:24:14',0,0,'2019-09-08 23:24:14','أكشن,خيال,رومانسي,فنون قتال',NULL,',manga updates::https://www.mangaupdates.com/series.html?id=151271',NULL,NULL,'صينية مانها','غير معروفة',NULL,NULL,0,0),(15614,'Oushitsu Kyoushi Haine','المدرس الملكي هايني','王室教師ハイネ The Royal Tutor ',2013,'Akai Higasa','Akai Higasa','ملك لخمسة أمراء أحدهم ولي العهد القادم، يأتي بمدرس ملكي مميز لتعليم أولاده الأربعة الأخ