 Son ',NULL,'','','عندما استيقظ يي مو فجأة ، أدرك أن كل شيء من حوله بدا وكأنه قد تغير: لقد انتقل إلى الأرض الحديثة حيث الطاقة الروحية شحيحة. كان سيده الجميل من عالمه السابق في أي مكان يمكن رؤيته. والأهم من ذلك أنه وجد نفسه في جثة شاب تركته عشيرته لسبب محرج ... ',1,0,'2019-09-08 21:28:41',0,0,'2019-09-08 23:28:41','أكشن,شونين,مغامرات,قوى خارقة,راشد',NULL,'',NULL,NULL,'صينية مانها','مستمرة',NULL,NULL,0,0),(15619,'The One','الأولى','獨領風騷  ',2005,'Lee Nicky','Lee Nicky','ليلي فتاة تكره عالم الأزياء ، لأنها فقدت والديها العارضان المشهوران في حادث طائرة مُريع ، عندما بلغت سنّ السابعة عشر . عرضت عليها خالتها (مديرة وكالة عرض أزياء وعارضة سابقة) أن تدخل هذا المجال وتصبح عارضة , ولكنها كانت معارضة بشدّه. الى أن رأت صورة للعارض الأمريكي الشهير آنجوس , عندها... تبدأ ليلي في شقّ طريقها بهذا المجال....',1,0,'2019-09-08 21:28:46',0,0,'2019-09-08 23:28:46','دراما,رومانسي,شوجو,كوميدي,نفسي,راشد',NULL,'mal::http://myanimelist.net/manga/3715/The_One,manga_fox::http://mangafox.me/manga/the_one/,manga updates::https://www.mangaupdates.com/series.html?id=3189',NULL,NULL,'صينية مانها','منتهية',NULL,NULL,0,0),(15620,'Tou Tiao Dou Shi Ta','','  ',NULL,'You Ling','You Ling','\"هو دائما يمتلك العناوين الرئيسية \" هذه القصة عن ايثان , عضو في فرقة الاولاد المشهورة FLY مالذي يجعله محط الاهتمام ؟ لماذا يلقبونه بـ\"الايدوال المتخلف \"؟ اهو صحيح انه وغد مع الجميع ؟',1,0,'2019-09-08 21:28:59',0,0,'2019-09-08 23:28:59','الحياة اليومية,شوجو,كوميدي',NULL,'mal::https://myanimelist.net/manga/104945/Tou_Tiao_Dou_Shi_Ta,manga_fox::,manga updates::https://www.mangaupdates.com/series.html?id=138255',NULL,NULL,'كورية مانهوا','مستمرة',NULL,NULL,0,0),(15621,'Super Secret','','  ',NULL,'One','One',' الفتى الذي يعيش بجانب منزلي, هو صديق طفولتي, وهو في الواقع مستذئب!',1,0,'2019-09-08 21:29:11',0,0,'2019-09-08 23:29:11','الحياة اليومية,رومانسي,شوجو,كوميدي,قوى خارقة,ويب-تون',NULL,'mal::,manga_fox::http://mangafox.me/manga/super_secret/,manga updates::https://www.mangaupdates.com/series.html?id=123806&method=useful',