NULL,0,0),(15651,'Deatte 5-byou de Battle','المعركة في 5 ثوان بعد الاجتماع','出会って5秒でバトル Battle in 5 seconds after meeting. ',2015,' Harawata Saizou','Miyako Kashiwa','كان مجرد يوم معتاد.. أكيرا شيروياناجي ، وهو طالب في المرحلة الثانوية الذي يحب الألعاب و الحلويات الياباني، فجأة تم جره إلى ساحة المعركة من قبل فتاة غامضة تدعو نفسها ميون. يتم إخبار المشاركين بأنهم \"تم مسحهم من سجل العائلة ، وان عليهم المشاركة في تجربة ، و انهم قد اكتسبوا قدرات خاصة.\". أكيرا عازم على الفوز باللعبة مع قدرته الجديدة وتدمير المنظمة. مسلح بقوة لا يتوقعها أحد وبخبرته في الالعاب، تبدأ فترة جديدة من معركة الذكاء!',1,0,'2019-09-12 19:50:26',1,0,'2019-09-12 21:50:26','أكشن,شونين,قوى خارقة',NULL,'mal::https://myanimelist.net/manga/102690/Deatte_5-byou_de_Battle,manga_fox::,manga updates::',NULL,NULL,'يابانية مانجا','مستمرة',NULL,NULL,0,0),(15652,'General and her medic lover',NULL,'  ',NULL,'','','إلهة الحرب. هي الموت. إنها روح مئات الجنود. لقد قاتلت من أجل البلد ، لكن أمها كانت مؤطرة وقُتلت. أقسمت على الانتقام ، ولكن وجدت مؤامرة مروعة وراء ذلك. إنه المبارز. إنه طبيب معجزة. وهو أيضًا جاسوس مثالي التظاهر. انه لطيف ومخلص.أتى اليها بنيته،لكنه قد شافى جميع جروحها وقد وقع في حبها دون وعي.',1,0,'2019-09-12 19:50:34',0,0,'2019-09-12 21:50:34','تاريخي,دراما,رومانسي',NULL,'',NULL,NULL,'صينية مانها','مستمرة',NULL,NULL,0,0),(15653,'Don\'t flirt with his highness','لا تغازل جلالته','  ',NULL,'','','×مسترجلة خجولة طليقة و مضحكة ضد امير بارد و ماكر متعدد الشخصيات\n  \n°بعد ان استيقظت اكتشفت بأنها كانت ممددة في تابوت  و بشكل لا يصدق تحولت لرجل\n\n°لين هان ركعت و بكت بأن هذه الايام بعد السفر بالزمن ليست سهلة حتى الرجل الذي احبته احب رجل؟',1,0,'2019-09-12 19:50:38',0,0,'2019-09-12 21:50:38','الحياة اليومية,تاريخي,رومانسي,كوميدي,ويب-تون,زمنكاني',NULL,'',NULL,NULL,'صينية مانها','مستمرة',NULL,NULL,0,0),(15654,'The Queen Is Busy',NULL,'  皇后很忙',NULL,'','','تنتقل فتاة تبلغ من العمر 19 عامًا تدعى تشينغ تيان فجأة عبر الزمن إلى عهد سلالة ملكية مجهولة. في البداية ، ظنت أنها يمكن أن تدخل ببطء في معارك الحريم ، لكنها فوجئت 