بها لنيشيوكا لكنها قوبِلَت بالرفض. كيف أخذت الأمور هذا المنحنى يا ترى؟',1,0,'2019-09-12 19:52:36',0,0,'2019-09-12 21:52:36','دراما,رومانسي,شوجو,الحياة المدرسية',NULL,',manga updates::https://www.mangaupdates.com/series.html?id=138757',NULL,NULL,'يابانية مانجا','منتهية',NULL,NULL,0,0),(15665,'Rhapsody of Mulan','','  ',NULL,'知音漫客','知音漫客','null',1,0,'2019-09-12 19:52:45',0,0,'2019-09-12 21:52:45','أكشن,تاريخي,رومانسي,كوميدي,مغامرات,زمنكاني',NULL,'mal::,manga_fox::http://mangafox.me/manga/rhapsody_of_mulan/,manga updates::https://www.mangaupdates.com/series.html?id=142894',NULL,NULL,'صينية مانها','مستمرة',NULL,NULL,0,0),(15666,'Kubera','','쿠베라  A Girl With a God\'s Name',2010,'Currygom','Currygom','null',1,0,'2019-09-12 19:53:06',0,0,'2019-09-12 21:53:06','أكشن,خيال,دراما,رومانسي,شونين,غموض,كوميدي,مغامرات,ويب-تون',NULL,'mal::http://myanimelist.net/manga/42579/Kubera/,manga_fox::http://mangafox.me/manga/kubera/,manga updates::https://www.mangaupdates.com/series.html?id=58442',NULL,NULL,'كورية مانهوا','مستمرة',NULL,NULL,0,0),(15667,' the immortal girl and contract with the dimon','الفتاة الخالدة و عقدها مع الشيطان','死なずの少女は百鬼と契る  the immortal girl and contract with the dimon الفتاة الخالدة وعقدها مع مخلص الشيطان',NULL,'','','كاميا يويكو ، فتاة رأت روحًا لم يكن من المفترض أن تراها ، وبالتالي ، لا يمكن أن تموت. ولهذا السبب ، تقضي أيامها بمفردها ، تنحرف عن العائلة والأصدقاء. تتغير حياتها عندما تقابل ما يسمى \"نادي الشيطان\" ، وهو عدد من الأولاد الذين يتمتعون بسلطات غامضة. مدينة محمية بشياطين ؛ تبدأ قصة حياة مدرسية خيالية',1,0,'2019-09-12 20:01:01',0,0,'2019-09-12 22:01:01','خيال,رومانسي,شوجو,الحياة المدرسية',NULL,',manga_fox::https://ww2.mangafox.online/the-immortal-girl-and-her-contract-with-the-demon',NULL,NULL,'يابانية مانجا','مستمرة',NULL,NULL,0,0),(15668,'The Lady and Her Butler','','  ',NULL,'A De','A De','آخر شيء تريده سو اه هو وجود رجل في حياتها . لقد طفح كيلها من مكالمات امها حول مشاكل أحبائها ، من اصدقائها الذين يحاولون تدبير مواعيد لها ، من الفتيات اللاتي ينتظرن أميرهن الساحر. لكن عندما يعرض عليها رجلٌ محطم بدون مأوي ان يهتم بالمنزل في مقابل مأوي له ، سو اه تجد نفسها تقول حسنًا لاول مرة في حياتها. علي أي حال، من لا يريد ان يأتي للمنزل و يجد عشاءً مُعد منزليًا ، أغطية نظيفة ، ملابس تم كويها جيدًا؟',1,0,'2019-09-12 21:31:54',0,0,'2019-09-12 23:31:54','جوسيه,دراما,رومانسي',NULL,'mal::,manga_fox::,manga updates::https://www.mangaupdates.com/series.html?id=144174',NULL,NULL,'كورية مانهوا','مستمرة',NULL,NULL,0,0),(15669,'Karakai Jouzu no (Moto) Takagi-san','','  ',NULL,'Inaba Mifumi,Yamamoto Souichirou','Inaba Mifumi','مانجا فرعة من مانجا Karakai Jouzu no Takagi-san تتحدث عن حياة نيشيكاتا وتاكاغي وإبنتهما تشي',1,0,'2019-09-12 21:32:01',0,0,'2019-09-12 23:32:01','الحياة اليومية,رومانسي,شونين,كوميدي',NULL,'mal::https://myanimelist.net/manga/108187/Karakai_Jouzu_no_Moto_Takagi-san,manga_fox::,manga updates::https://www.mangaupdates.com/series.html?id=143893',NULL,NULL,'يابانية مانجا','مستمرة',NULL,NULL,0,0),(15670,'The Mythical Realm','','  ',NULL,'Shenjoy','Shenjoy','في عالم أسطوري. عالم من الدماء، عالم ينتصر القوي على الضعيف، ينحدر يي يون الى الجحيم لقتل حشد من الشياطين ويصعد إلى السماء لقتل الآلهة فقط لإثبات وجوده باعتباره الأقوى، عالم حيث كائن واحد يمكن أن يحكم على السماء والأرض.',1,0,'2019-09-12 21:32:25',0,0,'2019-09-12 23:32:25','أكشن,خيال,شونين,مغامرات,زمنكاني',NULL,'mal::,manga_fox::http://mangafox.me/manga/the_mythical_realm/,manga updates::https://www.mangaupdates.com/series.html?id=121645',NULL,NULL,'صينية مانها','مستمرة',NULL,NULL,0,0),(15671,'Revolted with anger','ثائر بالغضب ',' Revolted with anger  , my naughty sweetheartالشعور بالغضب',2018,'','','لأنها تسعى دائما إلى معالجة أخاها قررت غو السيطرة على الرئيس يو من أجل تحقيق مرادها ، و لكن إذا إكتشف أمرها و ورطها في السجن فكيف ستصبح علاقتهما بعدما تخرج من السجن كي تنتقم ، لكن ماذا سيحصل حينما تكتشف شيء أخرا فيه ؟',1,0,'2019-09-12 21:32:40',0,0,'2019-09-12 23:32:40','دراما,رومانسي',NULL,'',NULL,NULL,'صينية مانها','غير معروفة',NULL,NULL,0,0),(15672,'Anata e no Crescendo','يشبون لك','あなたへのクレッシェンド Crescendo to You ',2007,'Minase Ai','Minase Ai','\"عندما يمكنك لعب هذه النغمة ، العبها من أجلي ...\" كانت سوزونو تبحث دائمًا عن الصبي الذي أخبرها بذلك ، والذي التقت به في حفل موسيقي بيانو عندما كانت صغيرة. بعد الالتحاق بالمدرسة الثانوية ، تم اختيارها للعب البيانو لمرافقة مسابقة الجوقة. بدأت سوزونو التدرب مع ايبا-كن و فوجيساوا-كن من فصلها ، لكن فوجيساوا-كن أخبرها أنهما كانا يلتقيان عندما كانا صغيرين ...!؟',1,0,'2019-10-15 16:40:31',0,0,'2019-10-15 18:40:31','رومانسي,شوجو',NULL,',manga_fox::http://mangafox.me/manga/anata_e_no_crescendo/',NULL,NULL,'يابانية مانجا','منتهية',NULL,NULL,0,0),(15673,'Your Majesty, watch out','صاحب الجلاله احترس ',' Your Majesty, watch out ',NULL,'','','استيقظت ، وجدت نفسها بعد أن امتدت إلى قصر. أجبرها الإمبراطور على السرير ، وأخبرها بأنها صريحة وتنتمي إليه. استيقظت من جديد من قبل محظية وقيل لها أن تقتل نفسها على يد أحد الخصي ... \"لماذا أنا بائسة للغاية كفتاة مخططة زمنيا!\"',1,0,'2019-10-15 16:40:37',0,0,'2019-10-15 18:40:37','خيال,رومانسي',NULL,'',NULL,NULL,'صينية مانها','مستمرة',NULL,NULL,0,0),(15674,'Popular deskmate is a Cat','deskmate شعبية هو القط',' Popular deskmate is a Cat ',NULL,'','','نيل فو هو الرجل الأكثر شعبية في المدرسة. جمع كل الفتيات الذين يحبونه ويمكنك ملء ملعب كرة القدم كله! لكنه هو نفسه رجل بارد وغير عاطفي. بطلتنا شينا مو محظوظ جدا بعد سيئ الحظ. هي محاربة نيل فو ، لكن لهذا السبب ، أصبحت العدو العام لجميع الفتيات. أقامها بعض الناس حتى هاجموها. لمفاجأتها ، هذه المكدري الشعبية لها هوية سرية ، وهي ... إنه في الواقع قطة سوداء !!!',1,0,'2019-10-15 16:40:41',0,0,'2019-10-15 18:40:41','خيال,رومانسي',NULL,'',NULL,NULL,'صينية مانها','مستمرة',NULL,NULL,0,0),(15675,'Knuckle Girl','فتاة المفصل',' Knuckle Girl ',NULL,'','','ران ،فتاة ملاكمة في المدرسة الثانوية ، تخرج إلى أراضٍ خارجة عن القانون من المتنمرين وعصابات المدارس للانتقام من أجل أختها الصغرى المعتدية جنسياً.',1,0,'2019-10-15 17:54:59',0,0,'2019-10-15 19:54:59','أكشن,عنف,فنون قتال,الحياة المدرسية,ويب-تون',NULL,'',NULL,NULL,'كورية مانهوا','منتهية',NULL,NULL,0,0),(15676,'Purgatory Rebirth','نهضة المطهر',' Purgatory Rebirth ',NULL,'','','يتم قتل الشخصية الرئيسية من قبل حبيبته دون سابق إنذار. الآن حان الوقت لمعرفة الحقيقة.\n',1,0,'2019-10-15 17:55:03',0,0,'2019-10-15 19:55:03','إثارة,أكشن,خيال علمي,دراما,غموض,نفسي,ويب-تون',NULL,'',NULL,NULL,'كورية مانهوا','مستمرة',NULL,NULL,0,0),(15677,'Chichi Kogusa','','ちちこぐさ  Chichi Kogusa, Father and Child Grass',2013,'Tagawa Mi','Tagawa Mi','null',1,0,'2019-10-15 17:55:11',1,0,'2019-10-15 19:55:11','الحياة اليومية,سينين',NULL,'mal::http://myanimelist.net/manga/52043/Chichikogusa/,manga_fox::http://mangafox.me/manga/chichi_kogusa/,manga updates::https://www.mangaupdates.com/series.html?id=91762',NULL,NULL,'يابانية مانجا','مستمرة',NULL,NULL,0,0),(15678,'CEO\'s Top Secret  ',NULL,'   CEO Subscribed 대표님이 구독하셨습니다  CEO Subscribed  Daepyonimi Gudokasyeotseumnida',NULL,'','','null',1,0,'2019-10-15 17:55:17',0,0,'2019-10-15 19:55:17','جوسيه,دراما,رومانسي,كوميدي',NULL,',manga updates::https://www.mangaupdates.com/series.html?id=156381',NULL,NULL,'كورية مانهوا','مستمرة',NULL,NULL,0,0),(15679,'Kimetsu no Yaiba','قاتل الشياطين','鬼滅の刃 Demon Slayer ',NULL,'Gotouge Koyoharu','Gotouge Koyoharu','تانجيرو هو الابنُ الأكبرُ لعائلته التي فقدت عائلها. وفي أحدِ الأيام، يُخاطرُ تانجيرو بالذهابِ إلى قريةٍ أخرى لبيعِ الفحم. ولكن نظرًا لحلولِ الليل وانتشارِ إشاعاتٍ بوجودِ شياطينَ تجولُ قريبًا في الجبال، ينتهي بهِ الحالُ بأن يبيتَ ليلتهُ في منزلِ شخصٍ آخرَ بدلًا من العودةِ إلى منزله. وحينَ يصلُ إلى منزلهِ في الصباحِ التالي، يجدُ مأساةً مريعةً في انتظاره.',1,0,'2019-10-15 17:55:29',1,0,'2019-10-15 19:55:29','أكشن,تاريخي,شونين,كوميدي,وحوش,قوى خارقة',NULL,'mal::https://myanimelist.net/manga/96792/Kimetsu_no_Yaiba/,manga_fox::,manga updates::https://www.mangaupdates.com/series.html?id=130757',NULL,NULL,'يابانية مانجا','مستمرة',NULL,NULL,0,0),(15680,'Shoukoku no Altair','بلاد الطائر','将国のアルタイル Altair: A Record of Battles ',2007,'Katou Kotono','Katou Kotono','محمود هو أصغر باشا أنتخب في تركيا بعمر يناهز 17، وهو من دعاة السلام والذي يبدل كل جهده لمنع الحرب بين بلده و إمبراطورية بالتلين. على الرغم من ان نطاق القصة صغيرة فى البداية, لكن سرعان ما يمتد الى صراع دبلوماسى يضم القارة بأسرها.. ',1,0,'2019-10-16 23:19:42',0,0,'2019-10-17 01:19:42','أكشن,تاريخي,خيال,دراما,شونين,مغامرات',NULL,'mal::http://myanimelist.net/manga/1605/Shoukoku_no_Altair/,manga_fox::http://mangafox.me/manga/shoukoku_no_altair/,manga updates::https://www.mangaupdates.com/series.html?id=12229',NULL,NULL,'يابانية مانجا','مستمرة',NULL,NULL,0,0),(15681,'07-Ghost','07-شبح','セブンゴースト 07-Ghost ',2005,'Amemiya Yuki','Ichihara Yukino','تيتو كلاين عبد تم إحضاره إلى إمبراطورية بارسبورغ ليلتحق بالجيش والسبب هو أنه يمتلكالقدرة على إستخدام الزايفون سلاح يستخدم الأحرف الرونيه حيث أن هذه القوة لاتظهر للكثيرين!فتم الاهتمام به جيداً في الجيش. وعند اقتراب امتحان الجيش الصعب حيث لا يلتحق فيه سوى5 من 200 جندي يتعاهد تيتو مع صديقه ميكاجي ويقسمان على أن يجتازا الإمتحان معاً.  ملاحظة: الشابتر 25 هو تكملة الأحداث بعد الأنمي.',1,0,'2019-10-16 23:19:48',0,0,'2019-10-17 01:19:48','أكشن,جوسيه,خيال,دراما,كوميدي,مغامرات,قوى خارقة,تراجيدي',NULL,'mal::http://myanimelist.net/manga/1349/07-Ghost,الموقع الرسمي::,manga_fox::http://mangafox.me/manga/07_ghost/,manga updates::http://www.mangaupdates.com/series.html?id=1702',NULL,NULL,'يابانية مانجا','منتهية',NULL,NULL,0,0),(15682,'Haikyuu!!','سأفعل ذلك !!','ハイキュー!! Haikyu!! ',2012,'Furudate Haruichi','Furudate Haruichi','هيناتا شويو ، بعد رؤيته مباراة للكرة الطائرة، يهدف أن يصبح مثل العملاق الصغير ، وينضم الى نادي الكرة الطائرة في المدرسة المتوسطة . بعد أن عثر على أعضاء جدد، يشاركون في بطولة المدارس المتوسطة، حيث تتقاطع طرقهم مع درسة قوية ولديها ملك الملعب ، كاقياما توبيو . رغم خسارة فريقهم، شويو مازال يهدف للقمة و للانتقام من كاقياما. حين دخل المدرسة الثانوية، وجد مفاجأة حياته -- هو و كاقياما أصبحا في نفس المدرسة والنادي !!',1,0,'2019-10-16 23:19:59',0,0,'2019-10-17 01:19:59','دراما,رياضة,شونين,كوميدي,الحياة المدرسية',NULL,'mal::http://myanimelist.net/manga/35243/Haikyuu!!,manga_fox::http://mangafox.me/manga/haikyuu/,manga updates::https://www.mangaupdates.com/series.html?id=70999',NULL,NULL,'يابانية مانجا','مستمرة',NULL,NULL,0,0),(15683,'Eleceed','بذور الكهرباء','  Electroid‏\r\n',NULL,'','','كايدن، رجل ذو قدرات خارقة تقاتل ضد مستخدمين أخرين للقدرات، لكنه تعرض لإصابات خطيرة جعلته يختبئ في جسد قط، ليجده جي وو الفتى اللطيف عاشق القطط وينقذه على انه قط متشرد، لكن منذ الليلة الأولى تحدث مصائب متتالية تدخل جي وو عالما جديدا يعرف بعالم المستيقظين. ملاحظة: هذه القصة هي لنفس مؤلف النبلاء ',1,0,'2019-10-16 23:20:04',0,0,'2019-10-17 01:20:04','أكشن,كوميدي,قوى خارقة',NULL,'mal::,manga_fox::,manga updates::https://www.mangaupdates.com/series.html?id=150943',NULL,NULL,'كورية مانهوا','مستمرة',NULL,NULL,0,0);
